    <style>
        body {
            font-family: 'Arial', sans-serif;
            text-align: center;
            margin: 0;
            padding: 0;
            color: #fff;
            overflow: hidden;
        }
        #background-video {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: -1;
            pointer-events: none;
        }
        .container {
            background: rgba(0, 0, 0, 0.6);
            padding: 20px;
            border-radius: 10px;
            display: inline-block;
            margin-top: 50px;
            z-index: 1;
            position: relative;
        }
        h2 {
            margin-top: 0;
            font-size: 2em;
            text-shadow: 2px 2px 4px #000;
        }
        .section {
            margin: 20px 0;
        }
        label {
            font-size: 1.2em;
        }
        input[type="text"],
        input[type="number"] {
            padding: 10px;
            font-size: 1em;
            border: none;
            border-radius: 5px;
            margin: 10px 0;
        }
        .wordList {
            background: rgba(255, 255, 255, 0.2);
            padding: 10px;
            border-radius: 5px;
            margin-top: 10px;
            text-align: left;
            max-height: 200px; /* Make the word list scrollable */
            overflow-y: auto;
        }
        .phraseWord {
            display: inline-block;
            vertical-align: top;
            margin: 10px 20px;
            background: rgba(255, 255, 255, 0.2);
            padding: 10px;
            border-radius: 5px;
        }
        .matchingWords {
            margin-top: 10px;
        }
        #video-controls {
            margin-bottom: 20px;
        }
        #video-controls button {
            padding: 10px;
            font-size: 1em;
            border: none;
            border-radius: 5px;
            margin: 5px;
            cursor: pointer;
        }
    </style>
</head>

            wordsArrayPasted = pastedWords.trim().split('\n').map(line => {
                const [word, value] = line.split(':').map(item => item.trim());
                return { word, value: parseInt(value, 10) };
            });

            displayWords('words', wordsArrayPasted);

        function calculatePhrase() {
            const phraseInput = document.getElementById('phraseInput').value.toLowerCase();
            const words = phraseInput.split(/\s+/).filter(word => word.trim() !== '');

            wordsArrayPhrase = words.map(word => ({ word, value: calculateValueForWord(word) }));
            displayWordsInRows(wordsArrayPhrase);
            displayTotalValue('phrase', wordsArrayPhrase);
        }

        function displayWords(type, wordsArray) {
            const wordListDiv = document.getElementById(`${type}Result`);
            const results = wordsArray.map(entry => `${entry.word}: ${entry.value}`);
            wordListDiv.innerHTML = results.join('<br>');
        }

        function displayWordsInRows(wordsArray) {
            const phraseResultDiv = document.getElementById('phraseResult');
            phraseResultDiv.innerHTML = '';

            wordsArray.forEach(wordObj => {
                const wordContainer = document.createElement('div');
                wordContainer.className = 'phraseWord';
                wordContainer.innerHTML = `<strong>${wordObj.word} (${wordObj.value}):</strong>`;

                const matchingWords = wordsArrayPasted.filter(word => word.value === wordObj.value);
                const matchingWordsList = matchingWords.map(entry => entry.word).join('<br>');
                const matchingWordsDiv = document.createElement('div');
                matchingWordsDiv.className = 'matchingWords';
                matchingWordsDiv.innerHTML = matchingWordsList ? matchingWordsList : 'No matching words';

                wordContainer.appendChild(matchingWordsDiv);
                phraseResultDiv.appendChild(wordContainer);
            });
        }

        function displayTotalValue(type, wordsArray) {
            const totalValueDiv = document.getElementById(`${type}TotalValue`);
            const totalValue = wordsArray.reduce((acc, entry) => acc + entry.value, 0);

            totalValueDiv.innerText = `Total Value (${type.charAt(0).toUpperCase() + type.slice(1)}): ${totalValue}`;
        }

        function calculateValueForWord(word) {
            const length = word.length;
            let value = 0;

            for (let i = 0; i < length; i++) {
                if (word[i] === 'k') {
                    if (i < Math.floor(length / 2)) {
                        value += 20;
                    } else {
                        value += 100;
                    }
                } else if (i < length - 1) {
                    const twoLetters = word.substring(i, i + 2);
                    if (letterValues.hasOwnProperty(twoLetters)) {
                        value += letterValues[twoLetters];
                        i++; // skip the next character as it's part of a two-letter combination
                    } else {
                        const singleLetter = word[i];
                        if (letterValues.hasOwnProperty(singleLetter)) {
                            value += letterValues[singleLetter];
                        }
                    }
                } else {
                    const singleLetter = word[i];
                    if (letterValues.hasOwnProperty(singleLetter)) {
                        value += letterValues[singleLetter];
                    }
                }
            }

            return value;
        }

        function findWordsByNumber() {
            const numberInput = parseInt(document.getElementById('numberInput').value, 10);
            const matchingWords = wordsArrayPasted.filter(word => word.value === numberInput);
            displayMatchingWords(matchingWords);
        }

        function displayMatchingWords(matchingWords) {
            const numberResultDiv = document.getElementById('numberResult');
            const results = matchingWords.map(entry => `${entry.word}: ${entry.value}`);
            numberResultDiv.innerHTML = results.join('<br>');
        }
